    render(){
        return(
            <div className="container">
                <h1>This is the login page</h1>
                <input type="text" placeholder="Email"/>
                <input type="password" placeholder="Password"/>
                <button>Login</button>
                
                <ul>
                <li><Link to="/">Home</Link></li>
                </ul>
            </div>
        );
    }
}
